import data from "./data";

function App() {
  return (
    <div>
      <header>
        <a href="/">Gross Modas</a> 
      </header>
      <main>
        <h1>Produtos em Destaque</h1>
        {
          data.products
        } 
      </main>
    </div>
  );
}

export default App;
